import { Typography, Grid } from "@material-ui/core";
import React from "react";
import useStyles from "./AboutStyles";

const About = () => {
  const classes = useStyles();
  return (
    <>
      <Grid container item xs={12}>
        <Grid item xs={12} md={6}></Grid>
      </Grid>
    </>
  );
};
export default About;
